import React, { Component } from 'react';
import './App.css';
import Table1 from "./Components/Tabel/Table";

function onInsertRow(row) {
    let newRowStr = ''
    for (const prop in row) {
        newRowStr += prop + ': ' + row[prop] + ' \n'
    }
    alert('You inserted:\n ' + newRowStr)

}



function App() {
    const options = { afterInsertRow: onInsertRow }
    let Constdata = [
        {id: 1, name: 'Gob', value: '2'},
        {id: 2, name: 'Buster', value: '5'},
        {id: 3, name: 'George Michael', value: '4'}
    ];
    alert("jopa")
  return (
    <div className="App">
      <Table1 data={(Constdata, options)}/>
    </div>
  );
}

export default App;
